import React, { Component } from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import logo from './logoShuhai.png';
import { HashRouter as Router, Switch, Route, Link, Redirect } from 'react-router-dom';
import Home from '../Pages/Home/Home';
import About from '../Pages/About/About';
import Blog from '../Pages/Event/Blog';
import Contacts from '../Pages/Contacts/Contacts';
import '../Components/Header.css';
import GroupLessons from '../Pages/Event/GroupLessons';

export default class Header extends Component {
    render() {
        return (
            <>
            <Router>
            <Navbar className="nav-bar" collapseOnSelect expand="lg" variant="dark" sticky="top">
                <Container>
                    <Navbar.Brand className="logo-brand" href="/">
                        <img 
                            src={logo}
                            height="100%"
                            width="100%"
                            
                            alt="logo"
                        /> 
                    </Navbar.Brand>
                    <Navbar.Toggle aria-controls="responsive-navbar-nav"/>
                    <Navbar.Collapse id="responsive-navbar-nav" >
                        <Nav className="nav-bar-sh">
                            <Link className="nav-li" to="/" activeStyle = {{color: "rgb(11, 199, 199)"}}>Головна</Link>
                            <Link className="nav-li" to="/about" activeStyle = {{color: "rgb(11, 199, 199)"}}>Про мене</Link>
                            <Link className="nav-li" to="/event" activeStyle = {{color: "rgb(11, 199, 199)"}}>Події</Link>
                            <Link className="nav-li" to="/contacts" activeStyle = {{color: "rgb(11, 199, 199)"}}>Контакти</Link>
                            
                        </Nav>
                        
                        
                       
                    </Navbar.Collapse>
                    <div className="nav-number">
                               {/* <p>м. Рівне, Україна</p> */}
                                <p>+380<nobr> 50 375 45 76</nobr></p>
                                </div>
                </Container>
            </Navbar>
                
                    <Switch>
                        <Route exact={true} path="/" component={Home} />
                        <Route exact={true} path="/about" component={About} />
                         
                        <Route exact={true} path="/contacts" component={Contacts} />
                        <Route exact={true} path="/groupLessons" component={Blog} />
                        <Redirect from='/event' to='/groupLessons'/>
                    </Switch>
                </Router>
            </>
        )
    }
}
